import React, { useEffect, useState } from 'react';

interface SplashScreenProps {
  onFinish: () => void;
}

export default function SplashScreen({ onFinish }: SplashScreenProps) {
  const [isVisible, setIsVisible] = useState(true);

  useEffect(() => {
    const timer = setTimeout(() => {
      setIsVisible(false);
      // Additional delay for fade out animation
      setTimeout(() => {
        onFinish();
      }, 300);
    }, 2500); // 2.5 seconds

    return () => clearTimeout(timer);
  }, [onFinish]);

  return (
    <div
      className={`fixed inset-0 z-50 flex items-center justify-center bg-gradient-to-br from-slate-900 via-slate-800 to-slate-900 transition-opacity duration-300 ${
        isVisible ? 'opacity-100' : 'opacity-0'
      }`}
    >
      {/* Background pattern/texture */}
      <div className="absolute inset-0 bg-slate-900/90"></div>
      
      {/* Main splash content */}
      <div className="relative z-10 flex flex-col items-center justify-center text-center px-8">
        {/* Kenworth 100 Banner */}
        <div className="mb-8 animate-fade-in">
          <div className="bg-red-600 text-white px-8 py-4 rounded-lg shadow-2xl">
            <h1 className="text-4xl md:text-6xl font-bold tracking-wider">
              KENWORTH <span className="bg-white text-red-600 px-2 rounded">100</span>
            </h1>
          </div>
        </div>

        {/* WKI Logo and Text */}
        <div className="bg-slate-800/90 backdrop-blur-sm rounded-3xl p-8 shadow-2xl border border-slate-700 animate-scale-in" style={{ animationDelay: '0.5s' }}>
          {/* WKI Logo Icon */}
          <div className="flex items-center justify-center mb-6">
            <div className="bg-red-600 rounded-full p-4 shadow-lg">
              <div className="text-white font-bold text-2xl">
                <div className="border-4 border-white rounded-full w-16 h-16 flex items-center justify-center">
                  <div>
                    <div className="text-xs font-bold">K</div>
                    <div className="text-xs font-bold -mt-1">W</div>
                  </div>
                </div>
              </div>
            </div>
          </div>

          {/* WKI Text */}
          <div className="text-center">
            <h2 className="text-4xl md:text-5xl font-bold text-white mb-2">
              WKI
            </h2>
            <h3 className="text-2xl md:text-3xl font-bold text-white mb-4">
              KENWORTH
            </h3>
            <h4 className="text-xl md:text-2xl font-bold text-red-400 mb-2">
              THE WORLD'S BEST!
            </h4>
            <p className="text-slate-300 text-sm md:text-base">
              IF ANYONE COULD DO IT BETTER,
            </p>
            <p className="text-slate-300 text-sm md:text-base">
              THEY ALREADY WOULD BE!
            </p>
          </div>
        </div>

        {/* Service Management Text */}
        <div className="mt-8 animate-slide-up" style={{ animationDelay: '1s' }}>
          <div className="text-center">
            <h5 className="text-xl md:text-2xl font-bold text-red-400 mb-2">
              Service Management System
            </h5>
            <p className="text-slate-400 text-sm">
              Powered by PACCAR Dealer Excellence
            </p>
          </div>
        </div>

        {/* Loading indicator */}
        <div className="mt-12 animate-pulse" style={{ animationDelay: '1.5s' }}>
          <div className="flex space-x-2">
            <div className="w-3 h-3 bg-red-500 rounded-full animate-bounce"></div>
            <div className="w-3 h-3 bg-red-500 rounded-full animate-bounce" style={{ animationDelay: '0.1s' }}></div>
            <div className="w-3 h-3 bg-red-500 rounded-full animate-bounce" style={{ animationDelay: '0.2s' }}></div>
          </div>
        </div>
      </div>

      {/* Decorative elements */}
      <div className="absolute top-10 left-10 w-32 h-32 bg-red-600/10 rounded-full blur-xl"></div>
      <div className="absolute bottom-10 right-10 w-48 h-48 bg-red-600/5 rounded-full blur-2xl"></div>
    </div>
  );
}
